import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <body>
        <div>
          <a href="/transition" className="App-link">
            Transition
          </a>
        </div>
      </body>
    </div>
  );
}

export default App;
